def solver(input_grid):
    import numpy as np
    from scipy import ndimage

    grid = np.array(input_grid)
    height, width = grid.shape
    output = grid.copy()

    # Find background color (most frequent)
    colors, counts = np.unique(grid, return_counts=True)
    background = colors[np.argmax(counts)]

    # Find connected components of non-background pixels
    non_bg_mask = grid != background
    labeled, num_features = ndimage.label(non_bg_mask)

    l_shapes = []
    markers = []

    for label_id in range(1, num_features + 1):
        component_mask = labeled == label_id
        coords = np.argwhere(component_mask)

        if len(coords) == 1:
            # Single cell = marker
            r, c = coords[0]
            markers.append({'row': int(r), 'col': int(c), 'color': int(grid[r, c])})
        else:
            # Check if it's a 2-wide or 2-tall L-shape
            min_r, min_c = coords.min(axis=0)
            max_r, max_c = coords.max(axis=0)
            h = max_r - min_r + 1
            w = max_c - min_c + 1

            if w == 2 and h >= 3:
                l_shapes.append({
                    'type': 'vertical',
                    'row_start': int(min_r), 'row_end': int(max_r),
                    'col_start': int(min_c), 'col_end': int(max_c),
                    'length': int(h)
                })
            elif h == 2 and w >= 3:
                l_shapes.append({
                    'type': 'horizontal',
                    'row_start': int(min_r), 'row_end': int(max_r),
                    'col_start': int(min_c), 'col_end': int(max_c),
                    'length': int(w)
                })

    if not l_shapes or not markers:
        return output.tolist()

    L_length = l_shapes[0]['length']

    # Determine extension direction based on 4-count (fewer 4s = extension side)
    for l in l_shapes:
        if l['type'] == 'vertical':
            col1_vals = grid[l['row_start']:l['row_end']+1, l['col_start']]
            col2_vals = grid[l['row_start']:l['row_end']+1, l['col_end']]
            l['extend_dir'] = 'left' if np.sum(col1_vals == 4) <= np.sum(col2_vals == 4) else 'right'
        else:
