            row2_vals = grid[l['row_end'], l['col_start']:l['col_end']+1]
            l['extend_dir'] = 'up' if np.sum(row1_vals == 4) <= np.sum(row2_vals == 4) else 'down'

    # Build offset-color mappings from markers
    offset_colors_v, offset_colors_h = {}, {}
    vertical_l_shapes = [l for l in l_shapes if l['type'] == 'vertical']
    horizontal_l_shapes = [l for l in l_shapes if l['type'] == 'horizontal']

    for marker in markers:
        m_row, m_col, m_color = marker['row'], marker['col'], marker['color']

        for l in vertical_l_shapes:
            if l['row_start'] <= m_row <= l['row_end']:
                offset = m_row - l['row_start']
                offset_colors_v[offset] = m_color
                offset_colors_h[L_length - 1 - offset] = m_color

        for l in horizontal_l_shapes:
            if l['col_start'] <= m_col <= l['col_end']:
                offset = m_col - l['col_start']
                offset_colors_h[offset] = m_color
                offset_colors_v[L_length - 1 - offset] = m_color

    # Determine extent for each L-shape
    for l in l_shapes:
        if l['type'] == 'vertical':
            if l['extend_dir'] == 'left':
                aligned = [m for m in markers if m['col'] < l['col_start'] 
